import Swiper from '../autoload/_swiper';

class CasestudyGallery {

    constructor(){

        console.log('GalleryCarousel')

        var swiperClass = '.gallery-swiper';

        $(swiperClass).each(function ( index ) {

            console.log('GalleryCarousel')

            let swiperID = 'gallery-' + index;
            let swiperIDHash = '#gallery-' + index;

            $(this).attr('id', swiperID);

            let homeSwiper = new Swiper(swiperIDHash, {
                speed: 500,
                loop: true,
                //autoplay: {
                   // delay: 5000,
                    //disableOnInteraction: false,
                //},
                    on: {
                        init() {
                            setTimeout(() => {
                                window.dispatchEvent(new Event('resize'))
                            }, 200)
                        },
                    },

                });

            homeSwiper.on('transitionStart', function () {

                //console.log('transitionStart');

            });

            });

        }
    }

    export default CasestudyGallery
